import { motion } from "framer-motion";

const Resume = () => {
  return (
    <SkillsMainCont>
      <RowContainersOne>
        <SectionBoxes />
        <SectionBoxes />
      </RowContainersOne>

      <RowContainersTwo>
        <SectionBoxes />
        <SectionBoxes />
      </RowContainersTwo>
    </SkillsMainCont>
  );
};

export default Resume;
